import React from 'react'
// import "./ReliefHome.css"
import image1 from '../../';
import image2 from './images/save1.jpg';
import { useNavigate } from "react-router-dom";
import { Button, Card, Container } from 'react-bootstrap';




export default function Relief1() {

  const navigate = useNavigate();

  return (

    <Card className='card' style={{ width: '30rem' }}>

      <Card.Body className='d-flex justify-content-end'>Relief Provider ID</Card.Body>

      <Card.Header><h3>Rescue & Relief Request Received</h3></Card.Header>
      <br></br>

      <div className='imghome'>

        <img src={image1} height={200} width={200} alt='' />

        &nbsp;&nbsp;&nbsp;

        <img id='img2' src={image2} height={200} width={200} alt='' />

      </div>

      <br></br>


      <Container className='d-flex justify-content-center'>

        <Button onClick={() => { navigate("/relief2"); }}
          variant="success">Rescue Request</Button>

        &nbsp;&nbsp;&nbsp;

        <Button onClick={() => { navigate("/relief3"); }}
          variant="success">Food & Medical Request</Button>

      </Container>
      <br></br>

    </Card>



  )
}
